script: |
  super -f text -I q1114.sql | sort > q1114.out

inputs:
  - name: q1114.sql
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab2 WHERE + col0 NOT BETWEEN + + col2 AND ( + + col0 + - col2 - - 64 * - + col2 - - 62 + - + col1 );
  - name: tab2

outputs:
  - name: q1114.out
    data: |
      51
      67
      77
